INSERT INTO `global_messages` (`id`, `global_message`, `created_at`, `updated_at`) VALUES
(1, 'Supply Inventory Management System (SIMS) is still under account creation and encoding phase. For the meantime, please upload your e-signature on the Custom Information tab and/or upload a profile photo by clicking the JRMSU Logo. Thank you!', '2025-04-11 05:44:22', '2025-04-11 05:44:22'),
(2, 'Supplies request is now available. Please do not forget to upload your e-signature on the Custom Information tab and/or upload a profile photo by clicking the JRMSU Logo. SIMS is still receiving updates to provide a better experience for you. Thank you for your support!', '2025-06-26 08:43:46', '2025-06-26 08:43:46'),
(3, 'You may experience minor glitches due to the ongoing system updates. We apologize for the inconvenience and appreciate your understanding.', '2025-07-18 01:19:52', '2025-07-18 01:19:52'),
(4, 'SIMS is now updated to the latest version for Supplies Requisition. For unknown errors or bugs, please don\'t hesitate to contact the MIS Unit.', '2025-09-11 04:08:03', '2025-09-11 04:08:03'),
(5, 'SIMS is now updated to the latest version for Supplies Requisition. If you have encountered any errors or bugs, please don\'t hesitate to contact the MIS Unit.', '2025-09-15 00:44:28', '2025-09-15 00:44:28'),
(6, 'SIIS is now updated to the latest version.', '2025-11-16 12:22:20', '2025-11-16 12:22:20');
